import React from "react";

const Home = () => {
  return (
    <div>
      The Reel Ones is here to bring you the world's most GOATed films of all
      time, priced affordably. Films courtesy of the{" "}
      <a href="https://www.afi.com/">American Film Institute</a>. It's like
      Blockbuster, but you don't have to return the video like it's 1998. Film
      streaming prices are per 24 hours.
    </div>
  );
};

export default Home;
